\pard\sa200\sl360\slmult1\ul\b AMPLIACION DEL ASEGURADO\ulnone\b0\par
\pard\cf1 Circulando por la calle Don Bosco, se form\'f3 una fila de coches debido a una cuneta pronunciada de la intersecci\'f3n con la calle pellegrini, se avanzaba dos o tres metros y se frenaba  y en una oportunidad no llegue a frenar,  ahi se produce la colision, se baja el se\'f1or, unico ocupante del vehiculo y me dice que  le parece que le bajo la presi\'f3n,  entonces por las dudas llamo al servico de ambulancia de Escobar que es la localida en donde se produce dicha colisi\'f3n, llega la ambulacia , defensa civil, y la policia, se llevan al se\'f1or al hospital publico de Escobar y a mi me mandan a la comisaria 1ra de Escobar, despues de un rato,  la oficial pregunta si el se\'f1or va a realizar acciones legales o si se va a solucionar con el seguro, el se\'f1or dice que no va a realizar ninguna acci\'f3n,  entonces la oficial hace un acta en  donde consta esta decision (a mi no me dan copia de la misma), pero no se retuvieron los coches, asi que debo presumir que fue asi, \par
Por otro lado tuve la posibilidad de que un conocido vio el informe del hospital, el cual esta en la comisaria primera en donde dice que no se encontro lesion alguna.\f1\fs28\par
